schemaDefinition: "create or replace view SN_PARTNERSOASSOCIATION(\n\t\"ModifiedOn\"\
  ,\n\t\"PrePipelineID\",\n\t\"CreatedByName\",\n\t\"ModifiedBy\",\n\t\"SN_Name\"\
  ,\n\t\"SN_Number\",\n\t\"CreatedOn\",\n\t\"SN_Opportunity_GUID\",\n\t\"StateCodeName\"\
  ,\n\t\"SN_PrepipelineNumber\",\n\t\"SN_Partner\",\n\tSN_PARTNERSOASSOCIATIONID,\n\
  \t\"SN_PartnerName\",\n\t\"SN_TypeName\",\n\t\"SN_Type\",\n\tSN_SOLUTIONOROFFERING,\n\
  \t\"SN_OpportunityName\",\n\tETL_INSERT_DATE,\n\tETL_UPDATE_DATE\n) as\n\nselect\n\
  \         \"MODIFIEDON\"                               as           \"ModifiedOn\"\
  ,\n         \"SN_PREPIPELINEID\"                         as           \"PrePipelineID\"\
  ,\n         \"CREATEDBYNAME\"                            as           \"CreatedByName\"\
  ,\n         \"MODIFIEDBY\"                               as           \"ModifiedBy\"\
  ,\n         \"SN_NAME\"                                  as           \"SN_Name\"\
  ,\n         \"SN_SOLUTIONOROFFERINGNAME\"                as           \"SN_Number\"\
  ,\n         \"CREATEDON\"                                as           \"CreatedOn\"\
  ,\n         \"SN_OPPORTUNITY\"                           as           \"SN_Opportunity_GUID\"\
  ,\n         \"STATECODENAME\"                            as           \"StateCodeName\"\
  ,\n         \"SN_PREPIPELINEIDNAME\"                     as           \"SN_PrepipelineNumber\"\
  ,\n         \"SN_PARTNER\"                               as           \"SN_Partner\"\
  ,\n         \"SN_PARTNERSOASSOCIATIONID\"                as           \"SN_PARTNERSOASSOCIATIONID\"\
  ,\n         \"SN_PARTNERNAME\"                           as           \"SN_PartnerName\"\
  ,\n         \"SN_TYPENAME\"                              as           \"SN_TypeName\"\
  ,\n         \"SN_TYPE\"                                  as           \"SN_TYPE\"\
  ,\n         \"SN_SOLUTIONOROFFERING\"                    as           \"SN_SOLUTIONOROFFERING\"\
  ,\n         \"SN_OPPORTUNITYNAME\"                       as           \"SN_OpportunityName\"\
  ,\n         \"ETL_INSERT_DATE\"                          as           \"ETL_INSERT_DATE\"\
  ,\n         \"ETL_UPDATE_DATE\"                          as           \"ETL_UPDATE_DATE\"\
  \n\nFROM  RDS.\"DYNAMICS365\".\"SN_PARTNERSOASSOCIATIONS\" WHERE \"STATECODENAME\"\
  ='random';"
